    false,nt"url": null,nt"notes": "This annual narrative report for Pablo
    National Wildlife Refuge outlines Refuge accomplishments during the 1984 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Refuge administration is outlined; information about personnel, volunteer programs,
    funding, and safety is given. Habitat management is also covered; subjects include
    wetlands, forests, grasslands, grazing, fire management, and pest control. The wildlife
    section of the report discusses wildlife diversity, endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, and raptors. The public uses
    of the Refuge described in this report include interpretive programs, hunting, and
    fishing. The equipment and facilities section of the report provides information
    about new construction. Cooperative programs and items of interest are provided
    at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
